La lutte anti-sous-marine (ASM) désigne l'ensemble des tactiques de combat et de protection contre la menace représentée par les sous-marins. Elle met en œuvre plusieurs moyens complémentaires : 
* navires de surface, des escorteurs, équipés de sonars (essentiellement des frégates et des corvettes) ; 
* avion de patrouille maritime ; 
* hélicoptères ASM ; 
* sous-marins d'attaque. Le dispositif est dirigé depuis un des escorteurs anti sous-marin, à bord duquel est embarqué le commandant de l'opération de lutte anti-sous-marine.

